import React from "react";

const UserTable = ({ users }) => {
  console.log(users);
  return (
    <>
      <h2>{users.length} Sonuç Bulundu</h2>
      <table className="table table-dark text-dark table-striped table-hover">
        <thead>
          <tr scope="col">#</tr>
          <tr scope="col">İsim</tr>
          <tr scope="col">Soyisim</tr>
          <tr scope="col">Boy</tr>
          <tr scope="col">Kilo</tr>
          <tr scope="col">Kan Grubu</tr>
        </thead>
      </table>
    </>
  );
};

export default UserTable;
